import Link from 'next/link';

const Navbar = () =>  (

    <div>
        <ul>
            <li><Link href="/">Home</Link></li>
            <li><Link href="about">About Us</Link>
</li>
        </ul>
         <br/>
        
    </div>

);


export default Navbar;
